import React from 'react'

class App extends React.Component {

  state = {
    numero1 : '',
    numero2 : '',
    resultado : ''
  }
  render(){
    return(
      <div>
          <input type="text" value={this.state.numero1} 
          onChange={(e) => this.setState({nome: e.target.value}) } />

          O nome digitado foi: {this.state.nome}
      </div>
    )
  }
}

export default App;
